const depthSortFn = (a, b) => {
    if (a.depth < b.depth) {
      return -1;
    } else if (a.depth === b.depth) {
      return 0;
    } else {
      return 1;
    }
  };

export function renderPreviousWork(objc){
    objc = objc.replace(/(\r\n|\n|\r)/gm, "");
    const obj = JSON.parse(objc);
    const elementList = obj.tree;
    const canvasColor = obj.backgroundColor;
    let orederedList = elementList.sort(depthSortFn);
    console.log("Canvas color");
    console.log(canvasColor);
    setCanvasColor(canvasColor);

    orederedList.forEach((element) => {
        if(element.id.includes("SolidRect")){
            renderSolidRect(element);
        }   
        else if(element.id.includes("BorderedRect")){
            renderBorderedRect(element);
        }   
        else if(element.id.includes("SolidCircle")){
            renderSolidCircle(element);
        }   
        else if(element.id.includes("BorderedCircle")){
            renderBorderedCircle(element);
        }   
        else if(element.id.includes("Text")){
            renderText(element);
        }   
        else if(element.id.includes("DesignImage")){
           renderDesignImage(element);
        }   
        else if(element.id.includes("AlphaImage")){
           renderAlphaImage(element);
        }   
    })
}

function setCanvasColor(color){
    const functions = new CanvasFunctions();
    functions.setCanvasColor(color);
}

function renderAlphaImage(element){
    const functions = new CanvasFunctions();
    functions.addAlphaImage("_", element);
}

function renderDesignImage(element){

const functions = new CanvasFunctions();
functions.addImage("_", element);
}

function renderSolidRect(element){
    const functions = new CanvasFunctions();
    var rect = new fabric.Rect({
        top : element.top,
        left : element.left,
        width : element.width,
        height : element.height,
        fill :  element.color,
        strokeColor: element.strokeColor,
        strokeWidth: element.strokeWidth,
        opacity: element.opacity,
        angle: element.angle
    });
    
    rect.id =  element.id; //`MyRect${Date.now()}`;
    rect.name = "Rect";
    functions.addSolidRect("black", rect);
}

function renderBorderedRect(element){
    const functions = new CanvasFunctions();
    var rect = new fabric.Rect({
        top : element.top,
        left : element.left,
        width : element.width,
        height : element.height,
        fill :  element.color,
        strokeWidth: element.strokeWidth,
        stroke: element.strokeColor,
        opacity: element.opacity,
        angle: element.angle
    });
    rect.id =  element.id;
    rect.name = "Rect";
    functions.addSolidRect("black", rect);
}

function renderSolidCircle(element){
    const functions = new CanvasFunctions();
    var circle = new fabric.Circle({
        top : element.top,
        left : element.left,
        radius: element.radius,
        width : element.width,
        height : element.height,
        fill :  element.color,
        strokeColor: element.strokeColor,
        strokeWidth: element.strokeWidth,
        opacity: element.opacity
    });
    circle.id =  element.id;
    circle.name = "Circle";
    functions.addSolidCircle("black", circle);
}

