function renderText(element){
    const functions = new CanvasFunctions();
    var text = new fabric.Text(element.text,{ 
        top : element.top,
        left : element.left,
        width : element.width,
        height : element.height,
        fill: element.color,
        opacity: element.opacity,
        fontSize: element.fontSize,
        angle: element.angle
    });
    
    text.id = element.id;
    text.name = "Text"
    functions.addText('#ff55ff00',text);
}